/* Procedure structure for procedure `generateCalender` */

/*!50003 DROP PROCEDURE IF EXISTS  `generateCalender` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `generateCalender`()
BEGIN
Declare _start int;
declare _end Int;
Declare _date datetime;
declare _startDate Datetime;
set _start =4;
set _end =2600;
Set _startDate= DATE_ADD(CURDATE(), INTERVAL -5 MONTH);
DROP temporary table if exists _temp;
CREATE TEMPORARY TABLE _temp(
    `datetime` Datetime
  );
  while _start <= _end do
   
   set _date =  date_add(_startDate,interval _start day);
   insert into _temp(`datetime`)values(_date);
 
  set _start = _start + 1;
  ENd While;
  
  insert into dbbalancebuster.`calender` (`date`)  (select * from _temp);
  
end */$$
DELIMITER ;

